import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.css";
import "assets/scss/now-ui-dashboard.scss?v1.5.0";
import "assets/css/demo.css";
import AdminLayout from "layouts/Admin.js";
import Login from "views/"; // Asegúrate de tener este componente

// Ejemplo de un estado global simple para autenticación
const isAuthenticated = false; // Cambia esto según el estado real de autenticación

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route
        path="/admin/*"
        element={
          isAuthenticated ? <AdminLayout /> : <Navigate to="/login" replace />
        }
      />
      <Route
        path="*"
        element={<Navigate to={isAuthenticated ? "/admin/dashboard" : "/login"} replace />}
      />
    </Routes>
  </BrowserRouter>
);
